import { Route, Routes, BrowserRouter, Link } from "react-router-dom";
import logo from "./logo.svg";
import HelloWorld  from "./components/HelloWorld";

function App() {
  return (
    <BrowserRouter>
      <main className="flex flex-col items-center justify-center w-screen h-screen bg-slate-400">
        <img src={logo} className="w-96" alt="logo" />
        <h1 className="font-bold text-4x1">Desarrollo WEB con React</h1>
        <div className="flex gap-4">
          <Link to="/hola-mundo" className="font-bold text=2x text-blue-700" >
            Hola Mundo
          </Link>
        </div>
        <Routes>
          <Route path="/hola-mundo" exact component={HelloWorld} />
        </Routes>
      </main>
    </BrowserRouter>
  );
}

export default App;
